create table sisters
(
    mid   int          not null
        primary key,
    name  varchar(255) null,
    face  varchar(255) null,
    sign  varchar(255) null,
    level int          null,
    fans  int          null,
    demo1 varchar(255) null,
    demo2 varchar(255) null,
    demo3 varchar(255) null,
    demo4 varchar(255) null
);

